ao:"佬僗僚劳労勞咾哰唠嗠嘐嘮姥嫪崂嶗恅憥憦捞撈撩朥栳橑橯浶涝潦澇烙牢狫獠珯痨癆硓磱窂簩粩絡络老耢耮荖落蓼蛯蟧軂轑酪醪銠鐒铑铹顟髝鮱",ming:"佲冥凕名命姳嫇慏掵明暝朙榠洺溟猽盟眀眳瞑茗萌蓂螟覭詺鄍酩銘铭鳴鸣",hen:"佷哏噷很恨拫掀狠痕艮詪鞎",quan:"佺全券劝勧勸卷啳圈圏圳埢姾婘孉峑巏巻弮恮悛惓拳拴捲搼权栒桊棬椦楾槫権權汱泉洤湶灥烇牶牷犈犬犭獾琯瑔甽畎痊矔硂筌純絟綣縓纯绻腃荃葲虇蜷蠸觠詮謜譔诠跧踡輇辁酄醛銓鐉铨闎韏顴颧駩騡鬈鰁鳈鸛鹳齤",tiao:"佻儵咷啁姚嬥宨岧岹庣恌挑斢旫晀朓朷条桃條樤眺祒祧稠窕窱笤粜糶絩聎脁脩艞芀苕萔蓚蓧蓨蜩螩覜誂調调超趒趠跳踔迢銚鋚鎥铫鞗頫髫鯈鰷鲦齠龆",xiao:"佼侾俏俲傚削効叜叟号呺呼咲咻哓哨哮唠唬啋啸嗃嘋嘐嘨嘮嘯嘵嚣嚻囂姣婋孝宯宵小崤庨彇恔恷憢挠捎揱搜撓撨效敩斅斆晓暁曉枭枵校梟梢橚櫹歊歒歗殽毊洨消涍淆滧漻潇潚澩瀟灱灲烋焇熇熽燆燺爻狡猇獟獢痚痟皛皢睄硝硣穘窙笑笹筱筿箫箾篠簘簫絞綃縿绞绡翛肖胶脩膮芍茭莦萧萷蕭薂藃虈虓蛸蟂蟏蟰蠨訤詨誟誵謏謞謼譊踃較轇较逍郩銷销霄颵騷驍驕骁骄骚骹髇髐魈鴞鴵鵁鷍鷕鸮",xing:"侀倖兴刑哘坓坙型垶塂姓娙婞嫈嬹巠幸形性悻惺擤星曐杏洐涬滎煋熒狌猩瑆皨省睲研硎硏箵篂緈胜腥臖興荇荥莕蛵行裄觪觲謃邢郉醒鈃鉶銒鋞钘铏陉陘餳饧騂骍鮏鯹",kan:"侃偘冚凵刊勘喊坎埳堪堿塪墈崁嵁嵌惂戡扻栞槛檻欿歁監看瞰矙砍碪磡竷莰莶薟衎譼輡輱轁轗闞阚靬顑餡馅龕龛",lai:"來俫倈勑厲唻娕婡崃崍庲徕徠懶攋来梾棶櫴涞淶濑瀨瀬猍琜癞癩睐睞筙箂籁籟莱萊藾襰誺賚賴赉赖逨郲釐錸铼頼顂騋鯠鵣鶆麳黧",hua:"侉划劃劐化华吪哇哗嘩埖姡婲婳嫿嬅学學崋找搳摦撶敌杹桦椛槬樺檴浍滑澅澮猾獪璍画畫畵砉硴磆稞粿糀繣腂舙花芲華蒍蕐蘤蘳螖觟話誮諙諣譁譮话豁輠釪釫鋘錵鏵铧驊骅魤鮭鲑鷨黊",kua:"侉咵垮夸姱恗挎晇楇絓胯舿華蕐袔誇跨銙錁锞顝骻髁",guang:"侊俇僙光咣垙姯广広廣恍扩挄撗擴桄横櫎欟洸潢灮炗炚炛烡犷獷珖硄胱臦臩茪趪輄迋逛銧黆",lie:"例倈儠冽列劣劦劽咧哷埒埓奊姴峢巁巤忚挒挘捩擸栗棙櫑毟洌浖烈烮煭燤爄爉犣猎猟獵睙綟聗脟膊臘茢蛚裂趔躐迾邋颲鬛鬣鮤鱲鴷",mi:"侎冖冞冪劘咪哋嘧塓孊宓宻密尒尓尔峚幂幎幦幺弥弭彌戂摩摵擟擵攠敉榓樒檷櫁汨沕沵泌洣淧渳溟滵漞濔濗瀰灖熐爢爾猕獯獼瓕眫眯眽瞇瞴祕祢禰秘穈簚籋米粎糜糸縻罙羃羋脒芈苾葞蒾蓂蔝蔤藌蘼蜜蝆袮覓覔覛觅詸謎謐谜谧辟迷醚醾醿釄銤鑖镾靡鸍麊麋麛鼏",an:"侒俺儑匼厂厈咹唵啽垵垾埯堓婩媕安屽岸峖干广庵按揞晻暗案桉氨洝犴玵痷盒盦盫碪罯胺腤荌菴萻葊蓭裺誝諳谙豻貋遃鉗銨錌钳铵闇陰隂隌雸鞌鞍韽頇頞顸馣鮟鴳鵪鶕鹌黯",lu:"侓僇六剹勎勠卢卤嗠噜嚕嚧圥坴垆塶塷壚娽峍庐廘廬彔录戮挔捋捛掳摅摝撸擄擼攄攎枦栌椂樐樚橹櫓櫨氇氌泸淕淥渌滤滷漉漊潞澛濾瀂瀘炉熝爐獹玈琭璐璷瓐甪瘳盝盧睩矑硉硵碌磠祿禄稑穋箓簏簬簵簶籙籚粶緑纑绿罏翏肤胪膔膚膟臚舮舻艣艪艫芦菉蓼蓾蔍蕗蘆虂虏虜螰蠦角觮觻谷賂赂趢路踛蹗輅轆轤轳辂辘逯鄜酪醁鈩錄録錴鏀鏕鏴鐪鑥鑪镥陆陸露顱颅騄騼髗魯魲鯥鱳鱸鲁鲈鴼鵦鵱鷺鸕鸬鹭鹵鹿麓黸",mao:"侔冃冇冐冒勖務卯堥夘媢峁嵍帽愗懋戼描旄昴暓枆楙毛毣毷氂泖渵牟牦犛猫獏瑁皃眊瞀矛秏笷緢罞耄耗芼茂茅茆萺蓩蛑蝐蝥蟊袤覒貇貌貓貿贸軞鄚鄮酕鉚鉾錨铆锚霿髦髳鶜",gong:"供公共功匑匔厷咣唝嗊塨宫宮工巩幊廾弓恭愩慐拱拲攻杛杠栱汞渱熕珙碽篢糼紅红羾肱虹蚣蛩觥觵貢贑贛贡赣躬躳輁銾鞏髸魟龏龔龚",cun:"侟刌吋墫存寸忖拵村洊浚澊皴竴籿踆蹲邨",lv:"侣侶偻儢勴卛卢吕呂哷垏壘娄婁寠寽屡屢履嵂庐廬律慮慺捋旅曥梠榈樓櫖櫚櫨氀氯滤焒爈率瘻盧瞜祣稆穞穭箻篓簍累絽綠緑縷繂绿缕膂膐膢葎蒌蔞藘虑褛褸謱軁郘鋁録鏤鑢铝镂閭闾馿驢驴魯鲁鷜鹿",zhen:"侦侲偵唇圳坫塡塦填姫嫃寊屒帧帪弫慎戡抮挋振揕搸敒敶斟昣朕朾枕枮栕栚桢桭椹楨榐榛槇樼殝沴沵浈湞溱滇潧澵獉珍珎瑧甄畛疹眕眞真眹砧碪祯禎禛稹竧箴籈紖紾絼縝縥纼缜聄胗臻萙葴蒖蓁薽蜄袗裖覙診誫謓诊貞賑贞赈趁趂軫轃轸辴迧遉酖酙針鈂鉁鋴錱鍖鍼鎭鎮针镇阵陣陳震靕駗鬒鮝鱵鲞鴆鸩黮黰鼎鼑",ce:"侧側冊册刂厕厠墄嫧帻幘廁恻惻憡拺敇柵栅测測畟笧策筞筴箣簎粣荝萗萴蓛赦齰",chai:"侪儕勑叉喍囆差扠拆搓查柴犲瘥祡茈茝蔕虿蠆袃訍豺釵钗齜龇",nong:"侬儂农咔哝噥廾弄憹挊挵欁浓濃癑禯秾穠繷脓膿莀蕽襛農辳醲齈",hou:"侯候厚后吼吽呴喉垕堠帿後洉犼猴瘊睺矦篌糇翭翵腄葔詬诟豞逅郈鄇銗鍭餱骺鮜鯸鱟鲎鲘齁",jiong:"侰僒冂冋冏囧坰垧埛宭扃扄昋泂浻澃瀅炅炯烱煚煛熒熲燑燛窘絅綗臦臩蘏蘔褧迥逈銄鎣顈颎駉駫",tui:"侻俀僓啍墤娧尵弚弟忒怢推橔煺稅税穨聉脫脮脱腿蓷藬蘈蛻蜕褪謉讉蹆蹪追退隤頹頺頽颓饋馈駾騩骽魋",nan:"侽南喃囝囡妠娚婻嫨弇戁抩揇摊攤暔枏枬柟楠湳滩灘煵男畘腩莮萳蝻諵赧遖难難颌"